import React from 'react';

import TableItemCell from './TableItemCell';
import { isBig } from '../utils/otherUtils';
import ButtonDiv from './UI/ButtonDiv/ButtonDiv';

interface TableItemProps {
  typeTable: string,
  cells: any[],
}

const TableItem: React.FC<TableItemProps> = ({
  typeTable,
  cells

}) => {

  const cl = 'notesTableRow ' + typeTable;

  if (cells.length > 3) {
    return (
      <div className={cl}>
          {cells.map((cell, index) => <TableItemCell haveBigItem = {isBig(index)}>{cell}</TableItemCell>)}
          <ButtonDiv/>
      </div>
    );
  }
  else {
    return (
      <div className={cl}>
          {cells.map((cell) => <TableItemCell>{cell}</TableItemCell>)}
      </div>
    );
  }
}
  
  
export default TableItem;
